'use strict';

var curr = 0;
var prefixCounter = 0;
var prefix = "";
module.exports = {
    next:function(){
        curr++;
        if (curr>=Number.MAX_SAFE_INTEGER) {
            curr = 0;
            prefixCounter++;
            prefix += "i";

            if (prefixCounter>100) {
                prefixCounter = 0;
                prefix = "";
            }
        }
        return prefix+curr;
    }
};
